INSERT INTO `paginas` VALUES (1,'metatitulo','metadescripcion','keywords','tituelocontenido','fafdadfafdad','subtitulo','url pagina',NULL),(2,'metatitulo2','metadescripcion2','keywords2','Camino del Vino','<div align=\"left\" class=\"titulos_12_grisc\" style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; font-size: 10pt; padding-left: 15px; padding-right: 15px; line-height: normal;\">San Rafael es una zona de alta producci&oacute;n de vinos de calida. Esta como otras zonas dedicadas al cultivo de la vid son secas y &aacute;ridas con un bajo nivel de lluvias y humedad, factor determinante cuando se habla de la sanidad de las uvas.<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"331\" src=\"http://localhost/LATE%20NUEVA/vinos/vinosbodegas-intro.jpg\" width=\"500\" /><br />\r\nVinos en San Rafael</div>\r\n<br />\r\nLos d&iacute;as de sol abundantes y la amplitud t&eacute;rmica favorecen una buena maduraci&oacute;n y concentraci&oacute;n de aromas y color en los granos. Los suelos son profundos, permeables y pobres en materia org&aacute;nica, cualidades decisivas a la hora de obtener&nbsp;un buen vino. Debido al bajo r&eacute;gimen de lluvias, el riego se hace necesario. El agua proviene del deshielo de la Cordillera de los Andes que desciende en forma de r&iacute;os para convertirse en canales o acequias. Sin lugar a dudas la combinaci&oacute;n de estos factores hacen de&nbsp;San Rafael&nbsp;un oasis para la elaboraci&oacute;n de vinos de la m&aacute;s alta calidad.&nbsp;<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"434\" src=\"http://localhost/LATE%20NUEVA/vinos/toneles.jpg\" width=\"496\" /><br />\r\nVinos en San Rafael</div>\r\n<br />\r\nEn San Rafael podr&aacute; disfrutar del turismo del vino en todas sus facetas. Por esta raz&oacute;n nuestra Web cuenta con una gu&iacute;a completa de bodegas donde Uds. podr&aacute;n disfrutar de nuestros vinos. San Rafael Late Los invita a visitarla.&nbsp;</div>\r\n','subtitulo','url pagina2',3),(3,'metatitulo','metadescripcion','keywords','Resea Historica','<div align=\"left\" class=\"titulos_12_grisc\" style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; font-size: 10pt; padding-left: 15px; padding-right: 15px; line-height: normal;\">Ubicada en el sur de la provincia de Mendoza, San Rafael se encuentra a 232 km de la ciudad capital, enclavada en las proximidades de los r&iacute;os Atuel y Diamante, en medio de un paisaje de monta&ntilde;as, valles y sol ideales para vivir experiencias inolvidables. San Rafael ofrece una verdadera opci&oacute;n tur&iacute;stica gracias a la conjunci&oacute;n de sus imponentes zonas como el Valle Grande, Ca&ntilde;&oacute;n Atuel, El Nihil, diques y lagos Los Reyunos, El Tigre, Agua de Toro, entre otros, que brindan diversas alternativas para disfrutar la naturaleza con tranquilidad y seguridad para toda la familia.\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"398\" src=\"http://localhost/LATE%20NUEVA/Galeria%20de%20fotos/CiudadG.jpg\" width=\"501\" /><br />\r\nVista Aerea San Rafael</div>\r\n<br />\r\nSan Rafael cuenta con un intenso movimiento y una moderna urbanizaci&oacute;n. Pueden visitarse bodegas tradicionales de excelentes vinos, establecimientos frut&iacute;colas, vi&ntilde;edos y fincas de gran valor para actividades de turismo rural. Es punto de partida para realizar amplias actividades recreativas como rafting, trekking, mountain bike, wind surf, pesca, buceo, cabalgatas, enduro, 4 x 4, parapente y rappel en una zona con incre&iacute;bles bellezas naturales y rica en yacimientos geol&oacute;gicos y paleontol&oacute;gicos.&nbsp;<br />\r\n&nbsp;\r\n<div class=\"titulo_naranja_16\" style=\"font-family: Arial, Helvetica, sans-serif; font-size: 16px; font-weight: bold; color: rgb(255, 102, 0);\"><strong>Rese&ntilde;a Hist&oacute;rica</strong></div>\r\n<br />\r\nEl 2 de abril de 1805, el Teniente de Milicias Miguel Teles Meneses, por orden del Virrey Marques Rafael de Sobremonte funda a orillas del R&iacute;o Diamante, el fuerte San Rafael del Diamante, acci&oacute;n que hab&iacute;a sido solicitada por la cacique Mar&iacute;a Teresa Roco que viaj&oacute; hasta Buenos Aires para entrevistarse con el Virrey para explicarle que los constantes ataques de las tribus que ven&iacute;an de Chile destru&iacute;an sus pertenencias y cultivos, por lo que era necesario la fundaci&oacute;n de un Fuerte..&nbsp;<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"260\" src=\"http://localhost/LATE%20NUEVA/san%20rafael/vega_034.jpg\" width=\"376\" /><br />\r\nCanal en San Rafael</div>\r\n<br />\r\nEn el a&ntilde;o 1903 por el Decreto 262 del Gobierno Provincial fue trasladada la villa cabecera ,que se habia formado a los alrrededores del fuerte, a la Colonia Francesa ubicada a 20 km. al norte que se hab&iacute;a creado cuando el financista franc&eacute;s Rodolfo Isel&iacute;n viaja a &eacute;stas tierras y compra la zona comprendida entre Las Paredes y Canal Pavez invitando a sus amigos franceses a vivir en la zona. Se desarrolla all&iacute; una pujante comunidad, a la que se suman inmigrantes italianos, espa&ntilde;oles, &aacute;rabes. Esta zona, hoy San Rafael es declarada ciudad en el a&ntilde;o 1922.<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"260\" src=\"http://localhost/LATE%20NUEVA/san%20rafael/vega_032.jpg\" width=\"376\" /><br />\r\nCentro San Rafael a Principios de Siglo</div>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<p><br style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal; text-align: -webkit-center;\" />\r\n<br style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal; text-align: -webkit-center;\" />\r\n<br style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal; text-align: -webkit-center;\" />\r\n&nbsp;</p>\r\n','subtitulo','url pagina2',2),(6,'metatitulo','metadescripcion','keywords','Valle Grande','<div align=\"left\" class=\"titulos_12_grisc\" style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; font-size: 10pt; padding-left: 15px; padding-right: 15px; line-height: normal;\">Localizado a 37 kil&oacute;metros de la ciudad de&nbsp;<strong>San Rafael</strong>, saliendo por Av. Ballofet y tomando la ruta provincial 173, &iacute;ntegramente pavimentada. En las cercan&iacute;as de este comienza un camino sinuoso, pero bell&iacute;simo, cercado aun lado por un cord&oacute;n monta&ntilde;oso y al otro por intr&eacute;pido R&iacute;o Atuel. Adentr&aacute;ndonos en el<strong>&nbsp;Ca&ntilde;&oacute;n del Atuel</strong>.<br />\r\n&nbsp;\r\n<div align=\"center\"><a class=\"titulos_12_grisc\" href=\"http://www.despegar.com.ar/hoteles/hl-mdz-i1/hoteles-en-mendoza/?cid=19\" style=\"text-decoration: initial; font-size: 10pt; color: rgb(51, 51, 51); padding-left: 15px; padding-right: 15px; text-align: left;\">Hoteles en Mendoza</a></div>\r\n&nbsp;\r\n\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><br />\r\n<img alt=\"Valle Grande - San Rafael Mendoza\" height=\"381\" src=\"http://localhost/LATE%20NUEVA/circuitos%20turisticos/vallegrande/VALLE-GRANDE.jpg\" width=\"523\" /><br />\r\nEmbalse Valle Grande</div>\r\n<br />\r\nAl final del recorrido se encuentra la presa&nbsp;<strong>Valle Grande</strong>, que contiene el embalse, el cual un excelente lugar para la nataci&oacute;n, winsurf, pesca deportiva, paseo en catamar&aacute;n, etc. Tambi&eacute;n podemos disfrutar la noche del&nbsp;<strong>Valle Grande</strong>&nbsp;en confiter&iacute;as situadas junto a la presa ofreci&eacute;ndonos una visi&oacute;n magnifica del Valle. En el recorrido hacia la presa Valle Grande y a la orilla del camino disponemos de una gran variedad de camping, caba&ntilde;as, hoteles, restaurantes, etc., como tambi&eacute;n servicios de turismo aventura: cabalgatas, rafting, trekking, canotaje, rapel, parapente, cuatriciclos, much&iacute;simas actividades mas&nbsp;</div>\r\n','subtitulo','url pagina2',1),(7,'metatitulo','metadescripcion','keywordsf fa fafadfadfadfafafa fasfadfa  adfa  da','Los Vinos San Rafaelinos','<p>&nbsp;</p>\r\n\r\n<div align=\"left\" class=\"titulos_12_grisc\"><br />\r\n<strong><em>&quot;La Vitivinicultura tiene sus origenes en antiguas civilizaciones, siendo parte de mitolog&iacute;as milenarias. Numerosos son los elementos que dan testimonio de la antig&uuml;edad de esta actividad&quot;. </em></strong><br />\r\n<br />\r\nLa historia del vino se remonta al viejo testamento (Genesis 9:20) cuando es mencionado por No&eacute;. En Grecia antigua, el vino era tomado con agua (tomarlo sin mezclarlo era mal visto); Teocrito describe\r\n<p><img alt=\"\" src=\"http://sanrafaellate.com/imagenes/los_reyunos_destacado.png\" style=\"width: 306px; height: 253px; float: left;\" /></p>\r\na los vinos como venerables cuando cumpl&iacute;an los 4 a&ntilde;os de edad. Por aquel entonces era guardado en toneles, recipientes hechos en pieles de cabra y &aacute;nforas impermeabilizados con aceites y trapos engrasados; por lo que el aire estaba en contacto con el vino en todo momento. Los romanos deomstraron mejor cuidado y mejor vino a trav&eacute;s de los vinos Falernianos de un a&ntilde;o de a&ntilde;ejamiento introduciendo otros recipientes. Aunque de todas formas no se llego hasta la maduraci&oacute;n completa del vino cuando se introdujo la botella con corcho.<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\"><br />\r\nVinos en San Rafael</div>\r\n<br />\r\nSeg&uacute;n Juan Martelli (gu&iacute;a de los vinos finos argentinos): en excavaciones paleontol&oacute;gicas recientes se han descubierto restos prehist&oacute;ricos con f&oacute;siles de orujo o de uva prensada. En Egipto, Grecia y Roma se adoraba a Dioniso, Dios creador y protector de la vid. Pero quiz&aacute;s el hito m&aacute;s importante en la historia del vino se encuentra en la &uacute;ltima cena, cuando Jesucristo lo utiliz&oacute; como expresi&oacute;n de su sangre ante sus ap&oacute;stoles. El vino lleg&oacute; a ser para la nueva religi&oacute;n, que adquirir&iacute;a car&aacute;cter universal, una bebida indispensable para la celebraci&oacute;n del culto.<br />\r\nEn Egipto el vino se cultiv&oacute; hacia el siglo IV a.C. Jerogl&iacute;ficos hallados se&ntilde;alan la pr&aacute;ctica de la vitivinicultura en la antigua Babilonia. En la China de hace cuatro mil a&ntilde;os se distingu&iacute;a entre la fermentaci&oacute;n de la uva y el arroz. Las culturas griega y romana divinizaron el vino a trav&eacute;s de Dionysios (Bacco). Entre los a&ntilde;os 500 y 1600 de nuestra era Europa se convierte en el principal centro de producci&oacute;n de vinos del mundo. En el siglo XIX, la industria vitivin&iacute;cola de Francia era el medio de vida de parte importante de la poblaci&oacute;n. El vino sufr&iacute;a alteraciones y se enfermaba, causando serias p&eacute;rdidas a los cultivadores y a los en&oacute;logos.<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"339\" src=\"louis-pasteur.jpg\" width=\"502\" /><br />\r\nLouis Pasteurs -</div>\r\n<br />\r\nBuscando el remedio a este problema, el gobierno franc&eacute;s encomend&oacute; a Louis Pasteur la tarea de encontrar una soluci&oacute;n, entonces descubri&oacute; toda la mec&aacute;nica de la fermentaci&oacute;n. Pasteur realizaba sus investigaciones en una de las bodegas bordalesas, se le pregunt&oacute; por qu&eacute; todos los vinos de una misma cosecha, guardadas en toneles de la misma capacidad, envejec&iacute;an de una manera m&aacute;s o menos pareja, salvo uno de &eacute;stos que lo hac&iacute;a en forma mucho m&aacute;s o menos lenta. Pasteur, que ya conoc&iacute;a el comportamiento del vino, pidi&oacute; ser llevado ante el extra&ntilde;o tonel. No bien lo vi&oacute;, se dio cuenta de lo que estaba ocurriendo: el tonel en cuesti&oacute;n estaba cubierto con una capa de pintura que cubr&iacute;a los poros de la madera, impidiendo el ingreso del aire a trav&eacute;s de los peque&ntilde;&iacute;simos agujeritos que existen en la madera.<br />\r\n<br />\r\nEl vino, siendo un ser vivo, necesita del ox&iacute;geno que se filtra a trav&eacute;s de la madera.<br />\r\n&nbsp;</div>\r\n','subtitulo','hola',3),(8,'fasdfadfa','fasdfasfd','fasdfasfd','El Nihuil','<p style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; line-height: normal;\"><span lang=\"es-mx\">Emergiendo del Ca&ntilde;&oacute;n del Atuel a trav&eacute;s de una sinuosa cuesta ,a 85 Km. de la cuidad de San Rafael por el Ca&ntilde;&oacute;n y a 75 Km. por la ruta provincial 144, descubrimos la extensi&oacute;n del lago que conforma el dique El Nihuil.<br />\r\n<span lang=\"es\">&nbsp;&nbsp; El Nihuil</span><span lang=\"es-mx\">&nbsp;</span>permite apreciar un espect&aacute;culo de colorido sin igual, cuando los amantes del windsurf despliegan cientos de velas multicolores&nbsp;<span lang=\"es-mx\">y para&nbsp;</span>quienes practican el esqu&iacute; acu&aacute;tico<span lang=\"es-mx\">&nbsp;es un lugar ideal</span>. Sobre&nbsp;<span lang=\"es-mx\">el&nbsp;</span>margen derecho se levanta la Villa El Nihuil que cuenta con todos los servicios, delegaci&oacute;n municipal, capilla, centro de salud, servicio telef&oacute;nico, destacamento policial, estafeta y un camping.</span></p>\r\n\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; line-height: normal;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"360\" src=\"http://localhost/LATE%20NUEVA/circuitos%20turisticos/el-nihuil-3.jpg\" width=\"500\" /><br />\r\nMuelle en El Nihuil San Rafael</div>\r\n\r\n<p style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; line-height: normal;\"><u><strong>En el margen izquierdo se encuentra el Club de Pescadores de San Rafael, con camping, proveedur&iacute;a, caba&ntilde;as, restaurante, pileta de nataci&oacute;n, residencias de fin de semana, tel&eacute;fono p&uacute;blico, etc.</strong></u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><u style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; line-height: normal;\"><strong><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"282\" src=\"http://localhost/LATE%20NUEVA/circuitos%20turisticos/nihuil22.jpg\" width=\"500\" /><br />\r\nLago El Nihuil</strong></u></div>\r\n\r\n<div>&nbsp;</div>\r\n','dfadfafa','edit pagina',3),(9,'dasdas','dasdas','dsadasd','Villa 25 de Mayo','<div align=\"left\" class=\"titulos_12_grisc\" style=\"font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; font-size: 10pt; padding-left: 15px; padding-right: 15px; line-height: normal;\"><strong>Se encuentra a 25 Km. de </strong>la Ciudad de San Rafael, hacia el oeste saliendo por Av. Hip&oacute;lito Yrigoyen hasta ruta provincial 143, y es considerada un verdadero Museo habitado. Surgi&oacute; luego de la fundaci&oacute;n del Fuerte San Rafael del Diamante, all&aacute; por el a&ntilde;o 1805 como consecuencia de la necesidad de construir un centro poblacional. El fuerte ha sido declarado Monumento Hist&oacute;rico Nacional y la Iglesia Nuestra Se&ntilde;ora del Carmen, que conserva a&uacute;n las primeras im&aacute;genes y vestiduras de la &eacute;poca. Es una pintoresca localidad rodeada de &aacute;lamos; con caser&iacute;os del siglo XIX de adobe, muros altos y zaguanes rectos,, calles flaqueadas por centenarios carolinos recorridas por profundas acequias por donde corre el agua. Se destacan para conocer el &quot;Atelier de Raul Landete&quot;, conocido pintor sanrafaelino que pint&oacute; la Cruz de San Andr&eacute;s en el interior de la nave principal de la &quot;Catedral San Rafael Arc&aacute;ngel&quot;, en la ciudad de San Rafael<br />\r\n&nbsp;\r\n<div class=\"foto_Info_recuadro\" style=\"border: 1px solid rgb(102, 102, 102); margin: 2px; text-align: center; vertical-align: middle;\"><img alt=\"Valle Grande - San Rafael Mendoza\" height=\"400\" src=\"http://localhost/LATE%20NUEVA/circuitos%20turisticos/villa25mayoG.jpg\" width=\"500\" /><br />\r\nCapilla 25 de Mayo</div>\r\n<br />\r\n<br />\r\n&nbsp;</div>\r\n\r\n<p><br style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal; text-align: -webkit-center;\" />\r\n<br style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium; line-height: normal; text-align: -webkit-center;\" />\r\n&nbsp;</p>\r\n','','hola',1);
